pragma solidity ^0.4.23;

import "./Contributions.sol";
import "../ownership/Ownable.sol";

contract InvestorsWhitelist is Ownable {
    using Contributions for Contributions.Contribution;

    Contributions.Contribution VCContributors;

    function addToVC(address _beneficiary) public onlyOwner {
        VCContributors.add(_beneficiary);
    }

    function removeFromVC(address _beneficiary) public onlyOwner {
        VCContributors.remove(_beneficiary);
    }

    function whtielistedAsVC(address _beneficiary) public view returns (bool){
        VCContributors.check(_beneficiary);
    }

    modifier onlyVC(address _beneficiary) {
        require(whtielistedAsVC(_beneficiary));
        _;
    }

}
